import Header from "./header";
import Services from "./services";
import Achievements from "./achievements";
import About from "./about";

const welcomingHomePage = () => {
  return (
   <>
   <Nav />
  <section>
  <Header />
  </section>
  <section>
  <Services />
  </section>
  <section>
  <Achievements />
  </section>
  <section>
  <About />
  </section>
   </>
  );
}

export default welcomingHomePage;
